<html>
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0, user-scalable=no, minimal-ui">
<meta name="apple-mobile-web-app-capable" content="yes">
<meta name="apple-mobile-web-app-status-bar-style" content="black">
<meta name="HandheldFriendly" content="true">
<meta name="mobile-web-app-capable" content="yes">
<script src="mraid.js"></script>
<script>
var CTA = {
    onClick: function (store) {
        if (store === undefined)
            store = navigator.userAgent.toLowerCase().indexOf("android") > -1 ? "google" : "apple";
        var urls = {
            "google": "https://play.google.com/store/apps/details?id=burning.city.mad.survivors.idle.simulator.tycoon",
            "apple": "https://play.google.com/store/apps/details?id=burning.city.mad.survivors.idle.simulator.tycoon"
        };
        var url = urls[store];
        window.console.log("CTA Clicked store: " + store + " link: " + url);
        mraid.open(url);
    }
};
</script>
<style>
		html,body {
			touch-action: none
		}
		body {
			overflow: hidden;
		}
		#animation_container {
			position: absolute;
			margin: auto;
		}
		/*IE9*/
		*::selection {
			background-color: transparent;
		}
		*::-moz-selection {
			background-color: transparent;
		}
		* {
			-webkit-user-select: none;
			-moz-user-select: -moz-none;
			/*IE10*/
			-ms-user-select: none;
			user-select: none;
			/*You just need this if you are only concerned with android and not desktop browsers.*/
			-webkit-tap-highlight-color: rgba(0, 0, 0, 0);
		}
		input[type="text"],
		textarea,
		[contenteditable] {
			-webkit-user-select: text;
			-moz-user-select: text;
			-ms-user-select: text;
			user-select: text;
		}
		* {
			outline: none;
			-moz-user-select: none;
			-o-user-select: none;
			-ms-user-select: none;
			-webkit-user-select: none;
			user-select: none;
			touch-action: manipulation;
		}
		canvas:focus {
			outline: none;
		}
		@media (orientation: landscape) {
			canvas {
				top: 50%;
				left: 50%;
				transform: translate(-50%, -50%);
				 width: 100%;
			}
		}
		@media (orientation: portrait) {
			canvas {
			height: 100%;
			width: auto;
			left: 50%;
			top: 50%;
			transform: translate(-50%, -50%);
			}
		}
</style>

		if(this.isSingleFrame) {
			return;
		}
		if(this.totalFrames == 1) {
			this.isSingleFrame = true;
		}
		var root = this
		resizeBanner = function () {
			var WT = window.innerWidth
			var HT = window.innerHeight
			if (WT >= HT) {
				var t = 1080 / (window.innerWidth)
				root.bottom_ui.y= ((window.innerWidth + (window.innerHeight ))/2)*t
				//		root.ui2.y = (((window.innerWidth - (window.innerHeight ))/2)*t) + window.innerHeight*t
				//		root.ui2.x	= 0
			} else {
				var t = 1080/(window.innerHeight)
				root.bottom_ui.y = 1080
				//		root.ui.x = ((window.innerHeight - (window.innerWidth ))/2)*t + window.innerWidth*t	
				//		root.ui2.x = ((window.innerHeight - (window.innerWidth ))/2)*t
				//		root.ui2.y = 1080
			}
		}
		resizeBanner()
		window.onresize = function () {
			resizeBanner()
		}
		this.stop();
		//variables
		var root = this
		var main = this.main
		var reward = this.reward
		var chest = reward.chest
		var packshot = this.packshot
		var ui = this.bottom_ui
		root.cta.visible = false
		root.red.visible = false
		chest.clickable = true
		chest.addEventListener('click', function () {
			if (chest.clickable) {
				btnSFX.play()
				chest.gotoAndPlay(65)
				chest.clickable = false
			}
		})
		//window listeners - here we add some listeners to custom events, mostly for sounds and scene changing
		window.addEventListener('chestSFX', function () {
			chestSFX.play()
		})
		window.addEventListener('pok', function () {
			pok.play()
		})
		window.addEventListener('battlecry', function () {
			battlecry.play()
		})
		window.addEventListener('swoosh', function () {
			swoosh.play()
		})
		window.addEventListener('hit', function () {
			hitSFX.play()
		})
		window.addEventListener('shotgunshot1', function () {
			shot1.play()
		})
		window.addEventListener('shotgunshot2', function () {
			shot2.play()
		})
		window.addEventListener('shotgunRedraw', function () {
			redraw.play()
		})
		window.addEventListener('showabilities', function () {
			//show abilities
			root.cta.visible = true
			ui.gotoAndStop(66)
			createjs.Tween.get(ui)
				.to({
					alpha: 1
				}, 500, createjs.Ease.cubicOut)
				.call(showAbilities)
		})
		window.addEventListener('cardsRevealed', function () {
			createjs.Tween.get(reward)
				.wait(1000)
				.to({
					alpha: 0,
					visible: false
				}, 550, createjs.Ease.cubicIn)
				.call(playMain)
		})
		function playMain() {
			if (main.currentFrame <= 1) {
				main.gotoAndPlay(1)
				ui.play()
				ui.btn.clickable = true
				ui.addEventListener('click', startFight)
			}
		}
		function startFight() {
			if (ui.btn.clickable) {
				btnSFX.play()
				ui.btn.clickable = false
				hideUI()
				main.battle.gotoAndPlay(1)
			}
		}
		function hideUI() {
			createjs.Tween.get(ui)
				.to({
					alpha: 0
				}, 500, createjs.Ease.cubicIn)
		}
		function showAbilities() {
			ui.gotoAndPlay(67)
			root.red.visible = true
		}
	}
	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

<script>
var canvas, stage, exportRoot, anim_container, dom_overlay_container, fnStartAnimation;
function init() {
	canvas = document.getElementById("canvas");
	anim_container = document.getElementById("animation_container");
	dom_overlay_container = document.getElementById("dom_overlay_container");
	var comp=AdobeAn.getComposition("3AA6032C71BB0E46B012923A4985E5BB");
	var lib=comp.getLibrary();
	var loader = new createjs.LoadQueue(false);
	loader.addEventListener("fileload", function(evt){handleFileLoad(evt,comp)});
	loader.addEventListener("complete", function(evt){handleComplete(evt,comp)});
	var lib=comp.getLibrary();
	loader.loadManifest(lib.properties.manifest);
}
function handleFileLoad(evt, comp) {
	var images=comp.getImages();	
	if (evt && (evt.item.type == "image")) { images[evt.item.id] = evt.result; }	
}
function handleComplete(evt,comp) {
	//This function is always called, irrespective of the content. You can use the variable "stage" after it is created in token create_stage.
	var lib=comp.getLibrary();
	var ss=comp.getSpriteSheet();
	var queue = evt.target;
	var ssMetadata = lib.ssMetadata;
	for(i=0; i<ssMetadata.length; i++) {
		ss[ssMetadata[i].name] = new createjs.SpriteSheet( {"images": [queue.getResult(ssMetadata[i].name)], "frames": ssMetadata[i].frames} )
	}
	exportRoot = new lib.index();
	stage = new lib.Stage(canvas);
	stage.enableMouseOver();	
	//Registers the "tick" event listener.
	fnStartAnimation = function() {
		stage.addChild(exportRoot);
		createjs.Ticker.framerate = lib.properties.fps;
		createjs.Ticker.addEventListener("tick", stage);
	}	    
	//Code to support hidpi screens and responsive scaling.
	/*
	AdobeAn.makeResponsive(false,'both',false,1,[canvas,anim_container,dom_overlay_container]);	*/
	AdobeAn.compositionLoaded(lib.properties.id);
	fnStartAnimation();
}
</script>
